const BeautifulForm = () => {
    return (
        <div className="container">
            <h1 className="d-flex justify-content-center">This is the Beautiful Form Project!</h1>
            <p>It's not just a form. So, why not have some fun with it?</p>
        </div>
    );
};

export default BeautifulForm;
